		"esInfo": "", 
		"esText": "<b>Braids</b> is comprised of Raphaelle Standell-Preston, Austin Tufts, and Taylor Smith. Formed in 2007 in Alberta, they have solidified a decade-long reputation for their musical ingenuity and established themselves as one of Canada\'s most acclaimed art rock bands, garnering two Polaris Prize shortlists and winning the 2016 Juno Award for Alternative Album of the Year.<br><br>With Standell-Preston\'s vocals as the pillar of their sound, Braids weave organic and electronic elements together amidst a lyrical landscape that is intimate, explosive, and emotionally-immersive. Their albums have earned praise from Pitchfork, NPR, New York Times, T Magazine, NME, and The Guardian among many others. They have supported or toured with artists such as Toro Y Moi, The Antlers, Wye Oak, Purity Ring, and Friendly Fires along with festival appearances around the world including Glastonbury, Primavera, Osheaga, Hopscotch, and SXSW.<br><br>Braids began teasing their new album last fall with the release of \"Eclipse (Ashley),\" a song dedicated to Standell-Preston\'s best friend that sinks deep into a feeling of reverie for nature, the love found in friendship, and the vital essence of personal reflection. It was praised by Pitchfork, Stereogum, Paste, and The New York Times who stated \"Raphaelle Standell-Preston sings with openhearted earnestness.\"<br><br>A luscious and expansive release, Shadow Offering leads us through a sonic tapestry of narrative. With heart-breaking honesty and precision, listeners traverse a nuanced and complicated world: one full of beautiful contradiction. Although the album directs itself at the failures of people to love and be loved, it also seeks to restore justice and attain blissful union. Its arc crests through the dark towards the light and learns how to dance with the dizzying rhythms of the heart. The songs bubble, sustain, dissolve, expand and retract.", 
		"esName": "Braids", 
		"esId": "2684655"
	}, 
