		"esText": "<b>Harry Manx</b> has been dubbed an “essential link” between the music of East and West, creating musical short stories that wed the tradition of the Blues with the depth of classical Indian ragas. His unique sound is bewitching and deliciously addictive to listen to.<br><br>A successful touring performer, Manx has brought his breath-taking solo shows across Canada and into the USA, Australia and Europe. He has appeared at many prestigious festivals, world-class theatres, concert halls and infamous Blues clubs around the globe. Playing the Mohan Veena, lap steel, harmonica, stomp box, and banjo, Manx quickly envelops the audience into what has been dubbed “the Harry Zone” with his warm vocals and the hauntingly beautiful melodies of his original songs.<br><br>Blend Indian folk melodies with slide guitar blues, add a sprinkle of gospel and some compelling grooves and you’ll get Manx’s unique “mysticssippi” flavour. It’s hard to resist, easy to digest and keeps audiences coming back for more.", 
