		"esText": "<b>ELO AGAIN</b> are back with their stunning \'Re-Discovery Tour’, celebrating the truly universal music of Jeff Lynne and the Electric Light Orchestra. <br><br>Now in their 8th year, ELO AGAIN really give you a dramatic taste of what a legendary ELO concert would have been like back in their heyday – the whole experience is professionally re-enacted with a great sound reproduction, light show and visual effects.<br><br>They perform all the big hits – MR BLUE SKY, LIVIN’ THING, SWEET TALKIN’ WOMAN, SHINE A LITTLE LOVE, CONFUSION, LAST TRAIN TO LONDON, ROLL OVER BEETHOVEN, WILD WEST HERO, DON\'T BRING ME DOWN, THE DIARY OF HORACE WIMP, TELEPHONE LINE, TURN TO STONE plus many more.<br><br>As the UK’s No.1 tribute show, ELO AGAIN provide you with the spectacular live effect of ELO’s famous orchestrations, soaring strings and vocals. They certainly know how to entertain too, as the hits just keep on coming. Their version of MR BLUE SKY is breathtaking, full of passion and fervour; the whole auditorium will be on its feet.<br><br>Come along and relive the age of Glam Rock as ELO AGAIN pay tribute to the beautifully crafted songs of Jeff Lynne. You will revel in ELO’s unique symphonic rock style and hear some of the most unforgettable classic rock and pop songs of our generation.<br><br>The timeless MR BLUE SKY returns, so Roll Over Beethoven - Rock \'n Roll Is King.", 
