		"esText": "Assembled by members from each corner of the UK, alternative / indie / folk group <b>Huw & the Greater Good</b> came together in Leeds in 2017, bonded by a love of classic and contemporary groups, including Edward Sharpe and the Magnetic Zeros, Cage the Elephant and The Water Boys.<br><br>Fronted by the uncompromisingly powerful and soulful voice of Huw Eddy, their live show is lauded as a liberating and empowering experience. YouTuber Ryan Cassata’s enthusiastic review of the group indicted that they make you want to “dance with your lover and feel on top of the world. In the short time they’ve been together they’ve stolen the hearts of audiences from the stages of Boom Town Fair and Beautiful Days Festivals, in support of Molotov Jukebox, Tom Odell and folk legends Mad Dog Mcrea as well as via BBC Radio Scotland where they were playlisted in 2018.<br><br>Songs of self-discovery triumph and heartache inspire audiences to throw down their inhibitions like never before. They deliver – live and on record – nonstop, heart-on-sleeve, electric moments. Huw & the Greater Good are a band fast gaining momentum as one of the UKs most exciting acts and have only just begun. With a debut EP due for release in Spring 2020 and a further set of headline dates to be announced, the next 24 months are set to be huge – all for the Greater Good.", 
