		"esText": "A Montreal-born Grenadian-Canadian, <b>Kaia Kater</b> grew up between two worlds: one her family’s deep ties to folk music; the other the years she spent soaking up Appalachian music in West Virginia. Her old-time banjo-picking skills, deft arrangements, and songwriting abilities have landed her in the spotlight in North America and the UK, garnering critical acclaim from outlets such as NPR, CBC Radio, Rolling Stone, BBC Music, and No Depression.<br><br>Kaia started her career early, crafting her first EP <i>Old Soul </i>(2013) when she was just out of high school. Since then, she’s gone on to release two more albums, <i>Sorrow Bound</i> (2015) and <i>Nine Pin</i> (2016). Her most recent album weaves between hard-hitting songs that touch on social issues like the Black Lives Matter movement (<i>Rising Down</i>, <i>Paradise Fell</i>) and more personal narratives speaking to life and love in the digital age (<i>Saint Elizabeth</i>). <i>Nine Pin</i> won a Canadian Folk Music Award, a Stingray Rising Star Award and sent Kaia on an 18-month touring journey from Ireland to Iowa, including stops at The Kennedy Center, Hillside Festival and London\'s O2 Shepherd\'s Bush. For her third album, <i>Grenades</i> (October 2018, Folkways/acronym Records), she took a decidedly different direction, choosing to lean into a wider array of sounds and styles, in order to convey a wider array of emotions and topics, most notably her paternal ancestry. Grenades was nominated for a 2019 JUNO award and long-listed for the Polaris Music Prize.<br><br>\"<i>...plaintive, mesmerizing...writes and performs with the skill of a folk-circuit veteran...\" -Rolling Stone \"Where bluegrass meets Nina Simone</i>\" - The Guardian<br><br>\"<i>You want some authenticity in your folk music or bluegrass – I give you Kaia Kater.\" -No Depression \"A star in the making...</i>\" -Folk Alley<br><br>“<i>...One of the most remarkable Canadian folk records in some time...Kater\'s music is somehow ancient and brand new at the same time.</i>” -Tom Power, CBC Radio 2<br><br>\"<i>Sorrow Bound is a remarkably assured debut album which both honours tradition and declares Kater’s credentials as a distinctive, original artist.</i>\" Steve Hunt - fRoots Magazine (UK) - October 2015", 
